import type { Meta } from '@storybook/react';
import { TextInput } from '../components/Inputs/TextInput';
import { FormWrapper } from '../components/FormWrapper';
import { useState } from 'react';

const SampleTextInput = () => {
    const [text, setText] = useState<string>('')

    return <FormWrapper title='Write any text'>
        <TextInput onChange={(e) => setText(e.target.value)} value={text} placeholder="Enter text" />
    </FormWrapper>
}

const meta: Meta = {
    component: ({ onChange }) => {
        return <FormWrapper title='Write any text:'>
            <TextInput onChange={onChange} value="" placeholder="Enter text" />
        </FormWrapper>
    }
};

export const Default = () => <button>Click</button>;

export const Disabled = () => <button disabled>Click</button>;

export default meta;
